import { createSlice } from "@reduxjs/toolkit";

const testSlice = createSlice({
    name:'test',
    initialState:{
        testState:'test'
    },
    reducers:{
        testReducer:(state) => {
            console.log( state.testState );
        }
    }
});

export const { testReducer } = testSlice.actions;
export default testSlice.reducer;
